import "./styles/Home.css"

export default function Home() {
    const videoRef = useRef(null);

    useEffect(() => {
        videoRef.current.play()
    }, []);

    return (
        <div>
            <video src="/videos/sample-hero.mp4" ref={videoRef}/>
        </div>
    )

}
